package grail.extras;

import java.awt.GridLayout;

import javax.swing.JButton;
import javax.swing.JPanel;

@SuppressWarnings("serial")
public class Buttons extends JPanel {

	static final int
		BUTTON_SIZE1 = 40,
		BUTTON_SIZE2 = 50,
		SAY_LOCATION1 = 10,
		PASS_LOCATION = 50,
		APPROACH_LOCATION = 100,
		FAIL_LOCATION = 150,
		LOCATION2_COMMON = 10;

	static final String
		SAY = "Avatr Talk",
		PASSED = "Avatar Pass?",
		FAILED = "Go To Gorge",
		APPROACH = "Avatar Go To Guard";

	JButton passed;
	JButton say;
	JButton failed;
	JButton approach;

	public Buttons() {

		passed = new JButton();
		passed.setSize(BUTTON_SIZE2, BUTTON_SIZE1);
		passed.setText(PASSED);
		passed.setLayout(new GridLayout(1, 2));
		passed.setLocation(PASS_LOCATION, LOCATION2_COMMON);
		say = new JButton();
		say.setSize(BUTTON_SIZE2, BUTTON_SIZE1);
		say.setText(SAY);
		say.setLayout(new GridLayout(1, 2));
		say.setLocation(SAY_LOCATION1, LOCATION2_COMMON);
		failed = new JButton();
		failed.setSize(BUTTON_SIZE2, BUTTON_SIZE1);
		failed.setText(FAILED);
		failed.setLayout(new GridLayout(1, 2));
		failed.setLocation(FAIL_LOCATION, LOCATION2_COMMON);
		approach = new JButton();
		approach.setSize(BUTTON_SIZE2, BUTTON_SIZE1);
		approach.setText(APPROACH);
		approach.setLayout(new GridLayout(1, 2));
		approach.setLocation(APPROACH_LOCATION, LOCATION2_COMMON);
		this.setVisible(true);
	}


	public JButton getPassed() {
		return passed;
	}

	public JButton getSay() {
		return say;
	}

	public JButton getFailed() {
		return failed;
	}

	public JButton getAproach() {
		return approach;
	}




}

